// config
var reason = "Incêndio";
var event_id = "1.1.54890a01-6c8f-44d4-a546-dcd4b6b024fc";

// do not touch...
var date = new Date();
var start_date = date.toISOString().split("T")[0] + " 00:00";
var end_date = date.toISOString().split("T")[0]+ " 23:59";
reason += " (auto)";

// get specific cookies
function getCookie(cname) {
    let name = cname + "=";
    let ca = document.cookie.split(';');
    for (let i = 0; i < ca.length; i++) {
        let c = ca[i];
        while (c.charAt(0) == ' ') c = c.substring(1);
        if (c.indexOf(name) == 0) return c.substring(name.length, c.length);
    }
    return "";
}

// close specified segments
var doClose = function(mteId, segId, startDate, endDate, reason) {
    let rawData = `{"actions":{"_subActions":[{"_subActions":[{"_objectType":"roadClosure","action":"ADD","attributes":{"endDate":"${endDate}","eventId":"${mteId}","externalProvider":"","externalProviderId":"","forward":true,"fromNodeClosed":false,"id":"-107","permanent":false,"provider":null,"reason":"${reason}","segID":${segId},"startDate":"${startDate}"}},{"_objectType":"roadClosure","action":"ADD","attributes":{"endDate":"${endDate}","eventId":"${mteId}","externalProvider":"","externalProviderId":"","forward":false,"fromNodeClosed":false,"id":"-108","permanent":false,"provider":null,"reason":"${reason}","segID":${segId},"startDate":"${startDate}"}}],"name":"MultiAddRoadClosure"}],"name":"DescartesSerializationAction"}}`;

    let xhttp = new XMLHttpRequest();
    xhttp.withCredentials = true;
    xhttp.open("POST", '/row-Descartes/app/Features?ignoreWarnings=false', true);
    xhttp.setRequestHeader("Content-type", "application/json; charset=utf-8");
    xhttp.setRequestHeader("x-csrf-token", getCookie('_csrf_token'));
    xhttp.send(rawData);
}

function magicClosure() {
    // cycle through selected segments
    for (let i = 0; i < W.selectionManager.getSegmentSelection().segments.length; i++) {
        let obj = W.selectionManager.getSegmentSelection().segments[0];
        if (obj.type !== 'segment')
            continue;

        console.log("WME Magic: closing segment...");
        doClose(event_id, obj.getID(), start_date, end_date, reason);
    }

    // refresh closures
    setTimeout(function() {
        W.controller.reloadData();
    }, 500);
}

function init() {
    var bullet = document.createElement('SPAN');
    bullet.innerHTML = "<img width='33' src='data:image/png;base64,'>";
    bullet.addEventListener('click', magicClosure);
    document.getElementsByClassName("toolbar")[0].insertBefore(bullet,document.getElementsByClassName("toolbar")[0].firstChild.nextSibling);
}

setTimeout(function() {
    init();
}, 5000);
